import React from "react";

function CarouselItem(props) {
  return (
    <div class="carousel-item">
      <img
        class="d-block w-100"
        src={props.item.imgUrl}
        alt={props.item.id + " slajd"}
      />
    </div>
  );
}
export default CarouselItem;
